const getSizeValue = (size: IconSize) => {
  switch (size) {
    case IconSize.xl:
      return 48
    case IconSize.lg:
      return 32
    case IconSize.pb:
      return 20
    case IconSize.sm:
      return 14
    case IconSize.xs:
      return 10
    default:
      return 24
  }
}

export const Icon: React.FC<IconProps> = ({ name, size = IconSize.md, className }: IconProps) => {
  return (
    <svg
      width={getSizeValue(size)}
      height={getSizeValue(size)}
      viewBox={iconsViewBoxMap[name]}
      className={`${className} fill-brand-black stroke-brand-black`}
      fill="inherit"
    >
      <path
        fillRule="evenodd"
        clipRule="evenodd"
        d={iconsMap[name]}
        fill={iconsFillMap[name] || 'inherit'}
        stroke={iconsStrokeMap[name] || 'inherit'}
        strokeWidth={iconsStrokeWidthMap[name] || 'none'}
        strokeLinecap={iconsStrokeLinecap[name] as SVGProps<SVGPathElement>['strokeLinecap']}
        strokeLinejoin={iconsStrokeLineJoin[name] as SVGProps<SVGPathElement>['strokeLinejoin']}
      />
    </svg>
  )
}
